package no.uib.info233.tree;import java.util.Iterator;/** * An interface for a node in a general tree. *  * @author Frank M. Carrano * @author Timothy M. Henry * @version 4.0 */public interface GeneralTreeNode<T> {    T getData();    void setData(T newData);    boolean isLeaf();    Iterator<GeneralTreeNode<T>> getChildrenIterator();    void addChild(GeneralTreeNode<T> newChild);}